    width: 80px;
    height: 3px;
    position: relative;
    transform: none;
}

selector .audioplayer.skin-wave .volume_static:before {
    background-color: #E8E8E8;
    height: 3px;
}

selector .audioplayer .volume_static:before {
    height: 3px;   
    top: -1px;
    left: 22px;
}

selector .audioplayer.skin-wave .volume_active {
    height: 3px;
