","custom_css":"selector .ap-wrapper {
    padding: 0;
}

@media only screen and (max-width: 768px){
    selector .audiogallery .slider-main {
        max-width: 90% !important;
        padding-right: 35px !important;
        padding-left: 35px !important;
    }
}

@media only screen and (min-width:1024px) and (max-width: 1450px) {
    selector .audiogallery .slider-main {
        max-width: 80% !important;
    }
}
selector .audiogallery .slider-main {
    max-width: 70%;
    margin: 0 auto;
    box-shadow: 0 5px 25px rgba(0, 0, 0, 0.16);
    transform: translateY(-50%);
}

selector .audiogallery .slider-main .slider-clipper>.audioplayer {
    padding: 25px 15px 85px;
    overflow: hidden;
}
selector .audioplayer.skin-silver .ap-controls .meta-artist-con {
    position: absolute;
    overflow: visible;
    top: 98px;
}



selector .audioplayer .volume_static {
    width: 80px;
    height: 3px;
    position: relative;
    transform: none;
}

selector .audioplayer.skin-wave .volume_static:before {
    background-color: #E8E8E8;
    height: 3px;
}

selector .audioplayer .volume_static:before {
    height: 3px;   
    top: -1px;
    left: 22px;
}

selector .audioplayer.skin-wave .volume_active {
    height: 3px;
    background: linear-gradient(to right, rgba(235,51,73,1) 0%, rgba(244,92,67,1) 100%);
    left: 38px;
}

selector .zoomsounds-nav.skin-aura .menu-item .float-right {
    display: none;
}

selector .zoomsounds-nav.skin-aura .menu-item.has-extra-info:hover .menu-item-views {
    opacity: 1;
}

selector .zoomsounds-nav.skin-aura .menu-item {
    font-family: "Open Sans", Sans-serif;
    opacity: 1;
    border-bottom: 1px solid #FFFFFF33;
    padding: 25px 16px 25px 16px;
}

selector .zoomsounds-nav.skin-aura .menu-item .menu-item-number{
    font-size: 20px;
    line-height: 22px;
    font-weight: bold;
    font-style: normal;
    margin-right: 8px;
    color: #fff;
}


selector .zoomsounds-nav.skin-aura .menu-item .the-artist {
    display: none;
}

selector .zoomsounds-nav.skin-aura .menu-item .menu-item-number:after{
    content: '.';
    display: inline-block;
}

selector .zoomsounds-nav.skin-aura .menu-item .the-name {
    font-size: 20px;
    line-height: 22px;
    font-weight: 300;
    color: #fff;
    opacity: 1;
}

selector .menu-item-views .the-count {
    display: none;
}

selector .menu-item-views .svg-icon path {
    fill: #FFF;
}

selector .audiogallery.dzsag-loaded .nav-main {
    margin-top: 0;
}

selector .audioplayer.skin-silver .audioplayer-inner {
    align-items: center;
}
selector .player-but .svg-icon path {
    fill: #fff;
}

selector .audioplayer.skin-silver .ap-controls .scrubbar {
    position: absolute;
    width: calc(100% - 100px);
    top: 60px;
    margin-left: 50px;
}

selector .audioplayer.skin-silver .ap-controls .curr-time {
    position: absolute;
    top: 60px;
